import React, { Component } from 'react';
import Layout from '../../../components/Layout'

class RequestNew extends Component {
    state = {}
    render() {
        return (
            <Layout>
                <h3>New Request</h3>
            </Layout>
        );
    }
}

export default RequestNew;
